var layoutProps = {
    display: 'display',
    height: 'height',
    listStyle: 'listStyle',
    maxHeight: 'maxHeight',
    maxWidth: 'maxWidth',
    minHeight: 'minHeight',
    minWidth: 'minWidth',
    overflow: 'overflow',
    overflowX: 'overflowX',
    overflowY: 'overflowY',
    verticalAlign: 'verticalAlign',
    width: 'width',
};
export function layout(props) {
    var styles = {};
    for (var key in props) {
        if (key in layoutProps) {
            var attr = layoutProps[key];
            var value = props[key];
            styles[attr] = value;
        }
    }
    return styles;
}
